import React from 'react';
import { Link, useLocation } from 'react-router-dom';

const Sidebar: React.FC = () => {
  const location = useLocation();

  const menuItems = [
    { path: '/dashboard/', label: 'Dashboard', icon: 'üè†' },
    { path: '/dashboard/projects', label: 'Projects', icon: 'üìÅ' },
    { path: '/dashboard/chat', label: 'Chat', icon: 'üí¨' },
    { path: '/dashboard/editor', label: 'Code Editor', icon: 'üìù' },
    { path: '/dashboard/settings', label: 'Settings', icon: '‚öôÔ∏è' },
  ];

  return (
    <div className="w-64 bg-gray-800 shadow-sm border-r border-gray-700">
      <div className="p-4">
        <nav className="space-y-2">
          {menuItems.map((item) => (
            <Link
              key={item.path}
              to={item.path}
              className={`flex items-center px-3 py-2 rounded-md text-sm font-medium ${
                location.pathname === item.path
                  ? 'bg-blue-600 text-white'
                  : 'text-gray-300 hover:bg-gray-700 hover:text-white'
              }`}
            >
              <span className="mr-3">{item.icon}</span>
              {item.label}
            </Link>
          ))}
        </nav>
      </div>
    </div>
  );
};

export default Sidebar;
